import './directory.styles.scss';

const categories = [
  {
    id: 1,
    title: 'hats',
    imageURL: 'https://static.cropp.com/media/catalog/product/cache/1200/a4e40ebdc3e371adff845072e1c73f37/0/7/0772K-88X-050-1-465151_10.jpg', 
    route: 'shop/hats'
  },
  {
    id: 2,
